function createFloatingButton() {
    console.log('Criando o botão flutuante...');
    const container = document.createElement('div');
    container.style.position = 'fixed';
    container.style.bottom = '30px';
    container.style.right = '20px';
    container.style.padding = '10px';
    container.style.borderRadius = '10px';
    container.style.backgroundColor = '#fff';
    container.style.boxShadow = '0 4px 6px rgba(0, 0, 0, 0.1)';
    container.style.zIndex = '10000';

    // Ícone no topo (será atualizado mais tarde)
    const icon = document.createElement('img');
    icon.id = 'floatingButtonIcon';
    icon.style.width = '50px';
    icon.style.height = '50px';
    icon.style.marginBottom = '10px';
    container.appendChild(icon);

    // Switch estilizado na parte inferior
    const switchLabel = document.createElement('label');
    switchLabel.style.display = 'block';
    switchLabel.style.fontSize = '14px';
    switchLabel.style.cursor = 'pointer';
    switchLabel.style.display = 'flex';
    switchLabel.style.alignItems = 'center';

    const switchInput = document.createElement('input');
    switchInput.type = 'checkbox';
    switchInput.style.display = 'none'; // Esconde o checkbox real

    // Estilo personalizado para o botão de toggle
    const slider = document.createElement('span');
    slider.style.position = 'relative';
    slider.style.display = 'inline-block';
    slider.style.width = '60px';
    slider.style.height = '34px';
    slider.style.backgroundColor = '#ccc';
    slider.style.borderRadius = '34px';
    slider.style.transition = '0.4s';

    const sliderCircle = document.createElement('span');
    sliderCircle.style.position = 'absolute';
    sliderCircle.style.top = '4px';
    sliderCircle.style.left = '4px';
    sliderCircle.style.width = '26px';
    sliderCircle.style.height = '26px';
    sliderCircle.style.borderRadius = '50%';
    sliderCircle.style.backgroundColor = '#fff';
    sliderCircle.style.transition = '0.4s';

    // Aplicar a lógica de mudança de estado
    switchInput.addEventListener('change', function() {
        if (switchInput.checked) {
            slider.style.backgroundColor = '#4CAF50';
            sliderCircle.style.transform = 'translateX(26px)';
            startVerifying(); // Iniciar a verificação
        } else {
            slider.style.backgroundColor = '#ccc';
            sliderCircle.style.transform = 'translateX(0)';
            stopVerifying(); // Parar a verificação
        }
    });

    switchLabel.appendChild(switchInput);
    switchLabel.appendChild(slider);
    slider.appendChild(sliderCircle);

    container.appendChild(switchLabel);
    document.body.appendChild(container);

    // Atualiza o ícone com a imagem carregada
    updateIcon();
}

// Função para alternar o estado da função
function toggleFunction(event) {
    const isChecked = event.target.checked;

    // Mostrar no console se a verificação está ativada ou desativada
    if (isChecked) {
        console.log("Verificação ativada.");
        startVerifying(); // Iniciar a verificação
    } else {
        console.log("Verificação desativada.");
        stopVerifying(); // Parar a verificação
    }
}

// Função para verificar novo atendimento
function verificarNovoAtendimento() {
    const novoAtendimento = document.getElementById('serviceQueue');
    if (novoAtendimento && novoAtendimento.style.display !== 'none') {
        aceitarConversa();
    } else {
        console.log("Sem atendimento.");
    }
}

// Função para aceitar a conversa
function aceitarConversa() {
    console.log("Novo atendimento encontrado! Aceitando a conversa...");
    const botaoAceitar = document.getElementById('startNewChat');
    if (botaoAceitar) {
        botaoAceitar.click(); // Clica no botão "Atender o próximo"
    }
}

// Função para iniciar a verificação
function startVerifying() {
    window.attendanceInterval = setInterval(verificarNovoAtendimento, 3000); // Verificar a cada 3 segundos
}

// Função para parar a verificação
function stopVerifying() {
    clearInterval(window.attendanceInterval); // Para a verificação
}

// Função para atualizar o ícone
function updateIcon() {
    const icon = document.getElementById('floatingButtonIcon');
    if (icon) {
        icon.src = 'data:image/png;base64,'; // Caminho para a imagem carregada
    }
}

// Criar o botão flutuante na página
document.addEventListener('DOMContentLoaded', function() {
    createFloatingButton();
});

setTimeout(function() {
    createFloatingButton();
}, 1000);
